import { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from '../services/api';
import StatsCard from '../components/StatsCard';
import RecentApplications from '../components/RecentApplications';
import SavedPropertiesPreview from '../components/SavedPropertiesPreview';
import FeaturedProperties from '../components/FeaturedProperties'; // مكون جديد
import '../styles/TenantDashboard.css';

const TenantDashboard = () => {
  const [dashboardData, setDashboardData] = useState(null);
  const [featuredProperties, setFeaturedProperties] = useState([]);
  const [loading, setLoading] = useState({
    dashboard: true,
    properties: true
  });
  const [error, setError] = useState({
    dashboard: null,
    properties: null
  });

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        const response = await axios.get('/api/tenant/dashboard');
        setDashboardData(response.data);
      } catch (err) {
        setError(prev => ({...prev, dashboard: err.response?.data?.message || 'Failed to load dashboard data'}));
      } finally {
        setLoading(prev => ({...prev, dashboard: false}));
      }
    };

    // جلب العقارات المميزة
    const fetchFeaturedProperties = async () => {
      try {
        const response = await axios.get('/api/properties/featured?limit=4');
        setFeaturedProperties(response.data);
      } catch (err) {
        setError(prev => ({...prev, properties: err.response?.data?.message || 'Failed to load properties'}));
      } finally {
        setLoading(prev => ({...prev, properties: false}));
      }
    };

    fetchDashboardData();
    fetchFeaturedProperties();
  }, []);

  if (loading.dashboard) return <div className="loading">Loading dashboard...</div>;
  if (error.dashboard) return <div className="error">{error.dashboard}</div>;

  return (
    <div className="tenant-dashboard">
      <div className="dashboard-header">
        <h1>Welcome back,</h1>
        <p>Here's what's happening with your rentals</p>
      </div>

      <div className="stats-grid">
        <StatsCard 
          title="Active Applications" 
          value={dashboardData.stats.activeApplications} 
          icon="📝"
          link="/applications?status=active"
        />
        <StatsCard 
          title="Approved Rentals" 
          value={dashboardData.stats.approvedRentals} 
          icon="✅"
          link="/rentals"
        />
        <StatsCard 
          title="Saved Properties" 
          value={dashboardData.stats.savedProperties} 
          icon="❤️"
          link="/saved-posts"
        />
        <StatsCard 
          title="Unread Messages" 
          value={dashboardData.stats.unreadMessages} 
          icon="✉️"
          link="/messages"
        />
      </div>

      <section className="featured-properties">
        <div className="section-header">
          <h2>Featured Properties</h2>
          <Link to="/properties" className="view-all">View All Properties</Link>
        </div>
        {loading.properties ? (
          <p>Loading properties...</p>
        ) : error.properties ? (
          <p className="error">{error.properties}</p>
        ) : (
          <FeaturedProperties properties={featuredProperties} />
        )}
      </section>

      <div className="dashboard-sections">
        <section className="recent-applications">
          <div className="section-header">
            <h2>Recent Applications</h2>
            <Link to="/applications" className="view-all">View All</Link>
          </div>
          <RecentApplications applications={dashboardData.recentApplications} />
        </section>

        <section className="saved-properties">
          <div className="section-header">
            <h2>Saved Properties</h2>
            <Link to="/saved-posts" className="view-all">View All</Link>
          </div>
          <SavedPropertiesPreview properties={dashboardData.savedProperties} />
        </section>
      </div>

      <div className="quick-actions">
        <h2>Quick Actions</h2>
        <div className="actions-grid">
          <Link to="/properties" className="action-card">
            <div className="action-icon">🔍</div>
            <h3>Find Properties</h3>
          </Link>
          <Link to="/applications/new" className="action-card">
            <div className="action-icon">📄</div>
            <h3>New Application</h3>
          </Link>
          <Link to="/messages" className="action-card">
            <div className="action-icon">💬</div>
            <h3>Contact Landlords</h3>
          </Link>
          <Link to="/profile" className="action-card">
            <div className="action-icon">👤</div>
            <h3>Update Profile</h3>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default TenantDashboard;
